import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './logo.png';
import './App.css';
import {
  Navbar,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Button,
  Container,
} from 'reactstrap';

class App extends Component {
  render() {
      return (
            <div>
                  <Header/>
            </div>
        );
    }
}

class Header extends Component {
  render() {
      return (
            <div>
              <Container>

                <Navbar className = "dark" light expand = "md" >
                  <NavbarBrand href = "/" ><img src={logo} alt="logo" /></NavbarBrand> 
                  <Nav className = "ml-auto" navbar>
                  <NavItem >
                <NavLink href = "/components/" > Last releases </NavLink> </NavItem> <NavItem >
                 <NavLink href = "https://github.com/reactstrap/reactstrap" > My Movies </NavLink> 
                </NavItem>
                <Button color = "secondary" >11 films </Button>
                </Nav> </Navbar> 

                </Container>
            </div>
        );
    }
}

export default App;
